      its policies with regard to payments received by candidate committees for goods
      and services  provided. The Republican Party of Iowa owns and operates its own
      building and land at its headquarters in Des  Moines, Iowa. This committee does
      not recognize registered lobbyists or registrant committees for purposes of  aggregate
      contributions. The Republican Party of Iowa follows a best efforts policy/procedure
      that begins with a clean  and conspicuous request from donors for their full
      name, mailing address, occupation, and name of employer at the  initial solicitation
      for a contribution, informing the contributor of the requirements of federal
      law for the reporting of such  information, as required by under 11 CFR 104.7.
